script: |
  super -f text -I q3410.spq | sort > q3410.out

inputs:
  - name: q3410.spq
    data: |
      SELECT - 63 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT BETWEEN + - CAST ( NULL AS REAL ) - col0 AND CAST ( NULL AS INTEGER ) * + - ( - - col1 );
  - name: tab0

outputs:
  - name: q3410.out
    data: |
